description:
We were lucky enough to be allowed inside the prototype 1986-tube stock driving motor car. 

The caption reads:

&quot;In 1986, three four-car prototype trains were built for the Central line. They trialled new technology and interior design. Each had its own colour; red, blue and green. As well as extensive testing, the prototypes saw brief spells of passenger service on the Jubilee line in 1988 and 1989. This green car, number 16, comes from prototype Train C. Built by Metro-Cammelll, it was the first to be delivered. Developments in body construction include the doors being hung from the roof and not recessing into the bodies when opened.&quot;

